# https://adventofcode.com/2024/day/1
def Historian_Hysteria(list1, list2):
    list1.sort()
    list2.sort()
    list3 = []
    for listnum1, listnum2 in zip(list1, list2):
        x = listnum2 - listnum1
        list3.append(x)
    answer = sum(list3)
    return answer


